import React from "react";
import "../styles/head.css";
import btn from "../images/Vector.png";
import logo from "../images/Union 1.png";
import icons from "../images/search.png";
export default function HeadBar(props) {
  function handleClick() {
    props.Show(true);
  }
  return (
    <div className="head">
      <div className="logo">
        <span className="green">ATG.</span>
        <span className="black">
          W<img className="head-logo" src={logo} />
          RLD
        </span>
      </div>
      <div className="search">
        <input type="search" />
        <div className="placeholder">
          <img className="search-logo" src={icons} />
          Search your favourite group in ATG
        </div>
      </div>
      <div className="right">
        <span>Create account.</span>
        <span className="blue">It's free!</span>
        <button className="head-btn" onClick={handleClick}>
          <img src={btn} />
        </button>
      </div>
    </div>
  );
}
